import React, {useState} from 'react';
import logo from './logo.svg';
import './App.css';
import MapContainer from "./Components/MapContainer"

function App() {

   return (
    <div className="App">
          <MapContainer />
          {/* <iframe
              style={{width:"450px",
                      height:"500px",
                      frameborder:"0",
                      border:"0"
                    }}
              src="https://www.google.com/maps/embed/v1/search?key=AIzaSyDJ56l2Y_6K3vN5rH30aKddRVljnEsuR_Y&q=record+stores+in+Seattle" allowfullscreen>
          </iframe> */}
          <nav>
            <a><img className="logo" src="https://upload.wikimedia.org/wikipedia/commons/e/e6/Home_icon_black.png"/><br/>Home</a>
            <a><img className="logo" src="https://upload.wikimedia.org/wikipedia/commons/e/ed/Map_pin_icon.svg"/><br/>Map</a>
            <a><img className="logo" src="https://upload.wikimedia.org/wikipedia/commons/4/43/Noun_project_list_icon_1380018_cc.svg"/><br/>List</a>
          </nav>
      </div>
  );
}

export default App;
